export default function Divisores(){
  console.log("Hola desde divisores");

  for (let i = 1; i < 10; i++) {
    if (i % 2 == 0){
      const par = console.log(i);

    }
  }



  return(
    <div>
        <h1>Divisores</h1>
          <h2>Pares: {par}</h2>
    </div>
  )
}
